/*--------------------------------------------------------------------------*/

HPDF_EXPORT(HPDF_STATUS)
HPDF_UseCNSEncodings   (HPDF_Doc   pdf)
{
    HPDF_Encoder encoder;
    HPDF_STATUS ret;

    if (!HPDF_HasDoc (pdf))
        return HPDF_INVALID_DOCUMENT;

    /* Microsoft Code Page 936 (lfCharSet 0x86) GBK encoding */
    encoder = HPDF_CMapEncoder_New (pdf->mmgr,  "GBK-EUC-H",
                GBK_EUC_H_Init);

    if ((ret = HPDF_Doc_RegisterEncoder (pdf, encoder)) != HPDF_OK)
        return ret;

    /* Microsoft Code Page 936 (lfCharSet 0x86) GBK encoding
     * (vertical writing) */
    encoder = HPDF_CMapEncoder_New (pdf->mmgr,  "GBK-EUC-V",
                GBK_EUC_V_Init);

    if ((ret = HPDF_Doc_RegisterEncoder (pdf, encoder)) != HPDF_OK)
        return ret;

    /* EUC-CN encoding */
    encoder = HPDF_CMapEncoder_New (pdf->mmgr,  "GB-EUC-H",
                GB_EUC_H_Init);

    if ((ret = HPDF_Doc_RegisterEncoder (pdf, encoder)) != HPDF_OK)
        return ret;

    /* EUC-CN encoding (vertical writing) */
    encoder = HPDF_CMapEncoder_New (pdf->mmgr,  "GB-EUC-V",
                GB_EUC_V_Init);

    if ((ret = HPDF_Doc_RegisterEncoder (pdf, encoder)) != HPDF_OK)
        return ret;

    /* Unicode encoding */
    encoder = HPDF_CMapEncoder_New (pdf->mmgr,  "UniGB-UTF8-H",
                UniGB_UTF8_H_Init);

    if ((ret = HPDF_Doc_RegisterEncoder (pdf, encoder)) != HPDF_OK)
        return ret;

    /* Unicode encoding (vertical writing) */
    encoder = HPDF_CMapEncoder_New (pdf->mmgr,  "UniGB-UTF8-V",
                UniGB_UTF8_V_Init);

    if ((ret = HPDF_Doc_RegisterEncoder (pdf, encoder)) != HPDF_OK)
        return ret;

    /* Unicode encoding */
    encoder = HPDF_CMapEncoder_New (pdf->mmgr,  "UniGB-UTF16-H",
                UniGB_UTF16_H_Init);

    if ((ret = HPDF_Doc_RegisterEncoder (pdf, encoder)) != HPDF_OK)
        return ret;

    /* Unicode encoding (vertical writing) */
    encoder = HPDF_CMapEncoder_New (pdf->mmgr,  "UniGB-UTF16-V",
                UniGB_UTF16_V_Init);

    if ((ret = HPDF_Doc_RegisterEncoder (pdf, encoder)) != HPDF_OK)
        return ret;

    return HPDF_OK;
}
